/*
UserDBFilePerms are the file permissions used for the database file
*/
var UserDBFilePerms os.FileMode = 0600

/*
MaxPassHistory is the amount of password history which is kept
*/
var MaxPassHistory = 10

/*
MinPasswordLength is the minimal password length if strong passwords are enforced
*/
var MinPasswordLength = 8

/*
GoodPasswordLength is a good password length
*/
var GoodPasswordLength = 12

/*
UserDB is a thread-safe user database which is stored in an encrypted
file. User passwords are hashed with an individual salt.
*/
type UserDB struct {
	filename   string                  // File of the persistent map
	passphrase string                  // Encryption passphrase
	Data       map[string]*userDBEntry // Data of the persistent map
	DataLock   *sync.RWMutex           // Lock for data
}

/*
userDBEntry models an entry in the user database.
*/
type userDBEntry struct {
	Passhash        string                 // Password hash for user
	Salt            []byte                 // Password salt for user
	PasshashHistory []string               // Password hash history
	SaltHistory     [][]byte               // Password salt history
	Data            map[string]interface{} // User data
}

/*
NewUserDB creates a new user database object.
*/
func NewUserDB(filename string, passphrase string) (*UserDB, error) {
	var ud *UserDB

	ok, err := fileutil.PathExists(filename)

	if err == nil {
		ud = &UserDB{filename, passphrase, make(map[string]*userDBEntry),
			&sync.RWMutex{}}

		if ok {
			err = ud.load()
		} else {
			err = ud.flush()
		}
	}

	if err != nil {
		ud = nil
	}

	return ud, err
}

/*
AddUserEntry adds a new user entry.
*/
func (ud *UserDB) AddUserEntry(name, password string, data map[string]interface{}) error {
	var err error

	ud.DataLock.Lock()
	defer ud.DataLock.Unlock()

	if _, ok := ud.Data[name]; ok {
		return fmt.Errorf("User %v already exists", name)
	}

	// Generate a salt for the user

	salt := make([]byte, sha256.Size)

	if _, err = io.ReadFull(rand.Reader, salt); err == nil {

		// Hash the password

		passhash := sha256.Sum256(append(salt, []byte(password)...))

		ud.Data[name] = &userDBEntry{
			Passhash:        string((&passhash)[:]),
			Salt:            salt,
			PasshashHistory: []string{},
			Data:            data,
		}

		err = ud.flush()
	}

	return err
}

/*
UpdateUserData updates the data of a user entry.
*/
func (ud *UserDB) UpdateUserData(name string, data map[string]interface{}) error {
	ud.DataLock.Lock()
	defer ud.DataLock.Unlock()

	e, ok := ud.Data[name]

	if !ok {
		return fmt.Errorf("Unknown user %v", name)
	}

	e.Data = data

	return ud.flush()
}

/*
UpdateUserPassword updates the password of a user entry.
*/
func (ud *UserDB) UpdateUserPassword(name, password string) error {
	var err error

	if ud.CheckUserPassword(name, password) {
		return fmt.Errorf("Cannot reuse current password")
	}

	ud.DataLock.Lock()
	defer ud.DataLock.Unlock()

	e, ok := ud.Data[name]

	if !ok {
		return fmt.Errorf("Unknown user %v", name)
	}

	// Generate a new salt and passhash for the user

	salt := make([]byte, sha256.Size)

	if _, err = io.ReadFull(rand.Reader, salt); err == nil {
		passhash := sha256.Sum256(append(salt, []byte(password)...))

		// Store old hash in the history

		if len(e.PasshashHistory) < MaxPassHistory {
			e.PasshashHistory = append(e.PasshashHistory, e.Passhash)
			e.SaltHistory = append(e.SaltHistory, e.Salt)
		} else {
			e.PasshashHistory = append(e.PasshashHistory[1:], e.Passhash)
			e.SaltHistory = append(e.SaltHistory[1:], e.Salt)
		}

		// Store the new hash

		e.Passhash = string((&passhash)[:])
		e.Salt = salt

		err = ud.flush()
	}

	return err
}

/*
RemoveUserEntry removes an existing user entry.
*/
func (ud *UserDB) RemoveUserEntry(name string) error {
	ud.DataLock.Lock()
	defer ud.DataLock.Unlock()

	if _, ok := ud.Data[name]; !ok {
		return fmt.Errorf("Unknown user %v", name)
	}

	delete(ud.Data, name)

	return ud.flush()
}

/*
CheckUserPassword checks a given user password.
*/
func (ud *UserDB) CheckUserPassword(name string, password string) bool {
	ud.DataLock.RLock()
	defer ud.DataLock.RUnlock()

	// Check if the user exists - no specific error if the user does not exist!

	e, ok := ud.Data[name]

	if ok {

		// Generate passhash from given password

		passhash := sha256.Sum256(append(e.Salt, []byte(password)...))

		// Compare the passhashes

		ok = stringutil.LengthConstantEquals((&passhash)[:], []byte(e.Passhash))
	}

	return ok
}

/*
CheckUserPasswordHistory checks if a given password is part of the password history.
*/
func (ud *UserDB) CheckUserPasswordHistory(name string, password string) bool {
	ud.DataLock.RLock()
	defer ud.DataLock.RUnlock()

	// Check if the user exists - no specific error if the user does not exist!

	e, ok := ud.Data[name]

	if ok {

		ok = false

		for i, histPasshash := range e.PasshashHistory {
			histSalt := e.SaltHistory[i]

			// Generate passhash from given password

			passhash := sha256.Sum256(append(histSalt, []byte(password)...))

			// Compare the passhashes

			ok = stringutil.LengthConstantEquals((&passhash)[:], []byte(histPasshash))

			if ok {

				// Exit if we found a matching entry

				break
			}
		}
	}

	return ok
}

/*
AllUsers returns a list of all known users.
*/
func (ud *UserDB) AllUsers() []string {
	ud.DataLock.RLock()
	defer ud.DataLock.RUnlock()

	ret := make([]string, 0, len(ud.Data))

	for u := range ud.Data {
		ret = append(ret, u)
	}

	return ret
}

/*
UserExists checks if a user exists.
*/
func (ud *UserDB) UserExists(name string) bool {
	for _, u := range ud.AllUsers() {
		if u == name {
			return true
		}
	}
	return false
}

/*
UserData returns the user data for a given user.
*/
func (ud *UserDB) UserData(name string) (map[string]interface{}, bool) {
	var data map[string]interface{}

	ud.DataLock.RLock()
	defer ud.DataLock.RUnlock()

	e, ok := ud.Data[name]
	if ok {
		data = e.Data
	}

	return data, ok
}

/*
load loads the user database from a file.
*/
func (ud *UserDB) load() error {
	encContent, err := ioutil.ReadFile(ud.filename)

	if err == nil {
		var content string

		content, err = cryptutil.DecryptString(ud.passphrase, string(encContent))

		if err == nil {
			de := gob.NewDecoder(bytes.NewBufferString(content))

			err = de.Decode(&ud.Data)
		}
	}

	return err
}

/*
flush writes the user database to disk.
*/
func (ud *UserDB) flush() error {
	var buf bytes.Buffer

	err := gob.NewEncoder(&buf).Encode(ud.Data)

	if err == nil {
		var encContent string

		encContent, err = cryptutil.EncryptString(ud.passphrase, buf.String())

		if err == nil {

			err = ioutil.WriteFile(ud.filename, []byte(encContent), UserDBFilePerms)
		}
	}

	return err
}

/*
EnforcedUserDB is a UserDB in which a high password strength is enforced.
*/
type EnforcedUserDB struct {
	*UserDB
	config     map[string]bool
	configLock *sync.Mutex
}

/*
defaultPasswordCheckParams define the default password checks
*/
var defaultPasswordCheckParams = map[string]bool{
	"CheckHistory":       true, // Check the password history of the user
	"CheckDict":          true, // Check for dictionary password
	"PasswordLength":     true, // Check the password length
	"ContainUpperCase":   true, // Check the password contains upper case
	"ContainLowerCase":   true, // Check the password contains lower case
	"ContainNumber":      true, // Check the password contains a number
	"ContainSpecial":     true, // Check the password contains a special character
	"NotContainSequence": true, // Check the password does not contains a sequence
}

/*
NewEnforcedUserDB creates a new user database object.
*/
func NewEnforcedUserDB(filename string, passphrase string) (*EnforcedUserDB, error) {
	var eud *EnforcedUserDB

	ud, err := NewUserDB(filename, passphrase)

	if err == nil {
		eud = &EnforcedUserDB{ud, make(map[string]bool), &sync.Mutex{}}
		for k, v := range defaultPasswordCheckParams {
			eud.config[k] = v
		}
	}

	return eud, err
}

/*
PasswordCheckParams returns the current password check configuration.
*/
func (eud *EnforcedUserDB) PasswordCheckParams() map[string]bool {
	ret := make(map[string]bool)

	for k, v := range eud.config {
		ret[k] = v
	}

	return ret
}

/*
SetPasswordCheckParam sets a parameter of the password check configuration.
*/
func (eud *EnforcedUserDB) SetPasswordCheckParam(key string, value bool) {
	if _, ok := eud.config[key]; ok {
		eud.config[key] = value
	}
}

/*
EvalPasswordStrength evaluates the strength of a password and returns
a number from 0 to 10. Returns an overall scope a list of warnings and
an error (CompositeError) if the password is not acceptable.
*/
func (eud *EnforcedUserDB) EvalPasswordStrength(user, password string) (int, []string, error) {
	warnings := []string{}

	// Check if the password is acceptable at all

	if err := eud.IsAcceptablePassword(user, password); err != nil {
		return 0, warnings, err
	}

	// Evaluate how good the password actually is

	var lowerCount, upperCount, numberCount, symbolCount int

	for _, runeValue := range password {
		if unicode.IsLower(runeValue) {
			lowerCount++
		}
		if unicode.IsUpper(runeValue) {
			upperCount++
		}
		if unicode.IsNumber(runeValue) {
			numberCount++
		}
		if unicode.IsSymbol(runeValue) || unicode.IsPunct(runeValue) {
			symbolCount++
		}
	}

	score := 0

	if utf8.RuneCountInString(password) < GoodPasswordLength {
		warnings = append(warnings, fmt.Sprintf("Password should be at least %v characters long", GoodPasswordLength))
	} else {
		score += 3
	}

	if lowerCount < 2 {
		warnings = append(warnings, "Password should contain at least 2 lower case characters")
	} else {
		score++
	}
	if upperCount < 2 {
		warnings = append(warnings, "Password should contain at least 2 upper case characters")
	} else {
		score++
	}
	if numberCount < 2 {
		warnings = append(warnings, "Password should contain at least 2 numbers")
	} else {
		score++
	}
	if symbolCount < 2 {
		warnings = append(warnings, "Password should contain at least 2 special characters")
	} else {
		score += 2
	}

	_, word, dist := CheckForDictPassword(password)
	if dist != -1 && dist < len(word)+2 {
		wordlen := math.Max(float64(utf8.RuneCountInString(password)), float64(utf8.RuneCountInString(word)))
		rate := math.Floor(100.0 * (wordlen - float64(dist)) / wordlen)
		warnings = append(warnings, fmt.Sprintf("Password is vaguely similar to the common dictionary password %v (%v%% match)", word, rate))
	} else {
		score += 2
	}

	return score, warnings, nil
}

/*
IsAcceptablePassword checks if a given user password is acceptable.
*/
func (eud *EnforcedUserDB) IsAcceptablePassword(user, password string) error {
	err := errorutil.NewCompositeError()

	if eud.CheckUserPassword(user, password) {
		err.Add(fmt.Errorf("Cannot reuse current password"))
	}

	if eud.config["CheckHistory"] {
		if eud.UserDB.CheckUserPasswordHistory(user, password) {
			err.Add(fmt.Errorf("Password was used before within the last %v changes", MaxPassHistory))
		}
	}

	if eud.config["CheckDict"] {
		match, word, dist := CheckForDictPassword(password)
		if match {
			err.Add(fmt.Errorf("Password matches a common dictionary password"))
		} else if dist > 0 && dist < 5 {
			wordlen := math.Max(float64(utf8.RuneCountInString(password)), float64(utf8.RuneCountInString(word)))
			rate := math.Floor(100.0 * (wordlen - float64(dist)) / wordlen)
			err.Add(fmt.Errorf("Password is too similar to the common dictionary password %v (%v%% match)", word, rate))
		}
	}

	if eud.config["PasswordLength"] {
		if utf8.RuneCountInString(password) < MinPasswordLength {
			err.Add(fmt.Errorf("Password must be at least %v characters long", MinPasswordLength))
		}
	}

	var hasLower, hasUpper, hasNumber, hasSpecial, hasSequence bool
	oldRunes := make([]rune, 2)

	for i, runeValue := range password {
		if !hasLower {
			hasLower = unicode.IsLower(runeValue)
		}
		if !hasUpper {
			hasUpper = unicode.IsUpper(runeValue)
		}
		if !hasNumber {
			hasNumber = unicode.IsNumber(runeValue)
		}
		if !hasSpecial {
			hasSpecial = unicode.IsSymbol(runeValue) || unicode.IsPunct(runeValue)
		}
		if !hasSequence && i > 1 {
			hasSequence = runeValue == oldRunes[0] && runeValue == oldRunes[1]
		}

		oldRunes[1] = oldRunes[0]
		oldRunes[0] = runeValue
	}

	if eud.config["ContainUpperCase"] {
		if !hasUpper {
			err.Add(fmt.Errorf("Password must contain an upper case character"))
		}
	}

	if eud.config["ContainLowerCase"] {
		if !hasLower {
			err.Add(fmt.Errorf("Password must contain a lower case character"))
		}
	}
	if eud.config["ContainNumber"] {
		if !hasNumber {
			err.Add(fmt.Errorf("Password must contain a number"))
		}
	}
	if eud.config["ContainSpecial"] {
		if !hasSpecial {
			err.Add(fmt.Errorf("Password must contain a special character"))
		}
	}
	if eud.config["NotContainSequence"] {
		if hasSequence {
			err.Add(fmt.Errorf("Password must not contain a same character sequence"))
		}
	}

	if err.HasErrors() {
		return err
	}

	return nil
}

/*
AddUserEntry adds a new user entry.
*/
func (eud *EnforcedUserDB) AddUserEntry(name, password string, data map[string]interface{}) error {

	if err := eud.IsAcceptablePassword(name, password); err != nil {
		return err
	}

	return eud.UserDB.AddUserEntry(name, password, data)
}

/*
UpdateUserPassword updates the password of a user entry.
*/
func (eud *EnforcedUserDB) UpdateUserPassword(name, password string) error {

	if err := eud.IsAcceptablePassword(name, password); err != nil {
		return err
	}

	return eud.UserDB.UpdateUserPassword(name, password)
}

/*
CheckForDictPassword checks if the given password is a common password.
Returns if the given password is a direct match, the closest match in
the dictionary and how close it is expressed as Levenshtein distance.
If the distance is -1 then the given password is not common.
*/
func CheckForDictPassword(password string) (bool, string, int) {

	password = strings.ToLower(password)

	retWord := ""
	retDist := 999999

	for i := 0; i < 6 && i < len(password); i++ {

		// Do a binary search on the password list - we compare here the suffix
		// so the binary search finds good matches even if the common word has
		// some unusual prefix

		index := sort.SearchStrings(commonPasswordList, password[i:])

		if index < 0 || index >= len(commonPasswordList) {
			continue
		}

		foundWord := commonPasswordList[index]

		// Check for a direct match

		if i == 0 && foundWord == password {
			return true, password, 0
		}

		// Compute the Levenshtein distance - the outcome of this is basically
		// how many letters does an attacker need to change before they have
		// the correct word

		foundDist := stringutil.LevenshteinDistance(password[i:], foundWord) + i

		if foundDist < retDist {
			retDist = foundDist
			retWord = foundWord
		}
	}

	if retWord == "" {

		// No word found which comes even close

		retDist = -1
	}

	return false, retWord, retDist
}

// List of common passwords
// ========================

/*
commonPasswordList is a list of common passwords
*/
var commonPasswordList []string

/*
init is run before the application is started. This function will
initialize the commonPasswordList variable.
*/
func init() {
	gzipData, _ := base64.StdEncoding.DecodeString(commonPasswords)
	reader, _ := gzip.NewReader(bytes.NewBuffer(gzipData))
	rawData, _ := ioutil.ReadAll(reader)
	commonPasswordList = strings.Split(string(rawData), "\n")
}

/*
commonPasswords is a gzipped list of common passwords
*/
var commonPasswords = ``
